import { useEffect,useState } from "react";

function QuestRegisterPage(){
    const [stateList, setStateList]=useState([]);

    useEffect(()=>{
        fetchStates();
    },[]);

    async function fetchStates(){
        try{
            const response = await fetch("/QuestRegisterPage_state",{
                methods:"GET",
                
            }) 
            const stateData = await response.json();
            console.log(stateData);
        }
        catch(error){
            console.log("error",error);
        }

    }

    return (
        <div className="flex">
        <div className="w-1/5 bg-gray-200 p-4 h-full flex-col">
            <h2>States List</h2>
            {   
                stateList.map((index,state)=>(
                    <div key={index}>
                        {console.log(state)}
                        {state}
                    </div>
                ))
            }
                    </div>
        <div className="w-full bg-gray-300 p-4 h-full">Main Content</div>
        <div className="w-1/4 bg-gray-200 p-4 h-full">Sidebar</div>
      </div>
    )



}



export default QuestRegisterPage;
